CREATE TABLE IF NOT EXISTS food_delivery (id VARCHAR(10) NOT NULL, delivery_person_id VARCHAR(20) NOT NULL, delivery_person_age INTEGER NOT NULL, delivery_person_ratings REAL NOT NULL, restaurant_latitude REAL NOT NULL, restaurant_longitude REAL NOT NULL, delivery_location_latitude REAL NOT NULL, delivery_location_longitude REAL NOT NULL, type_of_order VARCHAR(20) NOT NULL, type_of_vehicle VARCHAR(50) NOT NULL, time_taken INT NOT NULL);